import "./App.css";
const Hello = (props) => {
  return (
    <div>
      <p>
        Hello {props.name}, you are {props.age} years old
      </p>
    </div>
  );
};

function App() {
  const name =  "agastech"
  const age = 10;
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name={name} age={20 + 10} />
      <Hello name="Daisy" age={age} />
    </div>
  );
}

export default App;
